import styled from 'styled-components'

export const OrgSpecCatCardWrapper = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  align-items: center;
  background-color: var(--basic-grey-bg);
  border-radius: 6px;
  border: 1.5px solid transparent;
  height: 134px;
  width: 104px;
  padding: 12px;
`
